\u8DDF`,paraId:117,tocIndex:26},{value:"3.\u65E0\u91CD\u590D\u5B57\u7B26\u7684\u6700\u957F\u5B50\u4E32",paraId:118,tocIndex:26},{value:"\u76F8\u540C",paraId:117,tocIndex:26},{value:`/**
 * @param {string} s
 * @return {number}
 */
var lengthOfLongestSubstring = function (s) {
    const window = new Map();
    let left = 0, right = 0;
    let res = 0;
    while (right < s.length) {
        const c = s[right];
        // \u7A97\u53E3\u589E\u5927
        right++;
        window.set(c, window.has(c) ? window.get(c) + 1 : 1);

        // \u5224\u65AD\u7A97\u53E3\u662F\u5426\u8981\u7F29\u5C0F
        while (window.get(c) > 1) {
            const d = s[left];
            left++;
            window.set(d, window.get(d) - 1);
        }
        res = Math.max(res, right - left);
    }

    return res;
};
