\u7A7A\u95F4\u590D\u6742\u5730O(mn)`,paraId:158,tocIndex:34},{value:"\u601D\u8DEF",paraId:159,tocIndex:34},{value:"\u673A\u5668\u4EBA\u5176\u5B9E\u53EA\u80FD\u5411\u53F3\u6216\u5411\u4E0B\u8D70",paraId:159,tocIndex:34},{value:"\u6DF1\u5EA6\u4F18\u5148\u904D\u5386",paraId:159,tocIndex:34},{value:"\u4F7F\u7528visited\u8FDB\u884C\u526A\u679D",paraId:159,tocIndex:34},{value:"\u8FDB\u884C\u8D8A\u754C\u5224\u65AD\u548CbitSum\u5224\u65AD\uFF0C\u8FD4\u56DE0",paraId:159,tocIndex:34},{value:"\u7136\u540E\u5F53\u524D\u8282\u70B9+\u5411\u4E0B\u548C\u5411\u53F3\u7684\u8282\u70B9\uFF1A",paraId:159,tocIndex:34},{value:"1+[i+1,j]+[i,j+1]",paraId:159,tocIndex:34},{value:"\u5373\u53EF",paraId:159,tocIndex:34},{value:`/**
 * @param {number} m
 * @param {number} n
 * @param {number} k
 * @return {number}
 */
var movingCount = function (m, n, k) {
    const visited = new Array(m).fill().map(_ => new Array(n).fill(false));

    const bitSum = (x) => {
        let sum = 0;
        while (x > 0) {
            sum += x % 10;
            x = Math.floor(x / 10);
        }
        return sum;
    }

    const dfs = (i, j) => {
        if (i >= m || j >= n || visited[i][j] || bitSum(i) + bitSum(j) > k) return 0;
        visited[i][j] = true;
        return 1 + dfs(i + 1, j) + dfs(i, j + 1);
    }

    return dfs(0, 0);
};
`,paraId:160,tocIndex:34},{value:"\u5251\u6307 Offer 34. \u4E8C\u53C9\u6811\u4E2D\u548C\u4E3A\u67D0\u4E00\u503C\u7684\u8DEF\u5F84",paraId:0},{value:"medium",paraId:161,tocIndex:34},{value:"\u5178\u578B\u7684\u56DE\u6EAF",paraId:162,tocIndex:35},{value:"\u904D\u5386\u4E00\u904D\u5C31\u51FA\u7ED3\u679C",paraId:162,tocIndex:35},{value:"\u904D\u5386\u8FC7\u7A0B\u4E2D\u8BB0\u5F55\u8D70\u8FC7\u7684\u8DEF\u5F84\uFF0C\u540C\u65F6\u8BB0\u5F55remain",paraId:162,tocIndex:35},{value:"\u5F53\u8D70\u5230\u53F6\u5B50\u8282\u70B9\u65F6\u9012\u5F52\u7ED3\u675F\uFF0C\u8FD9\u4E2A\u65F6\u5019\u5224\u65ADremain\u662F\u5426\u4E3A0\uFF0C\u82E5\u4E3A0\u8BF4\u660E\u662F\u4E00\u6761\u8DEF\u5F84\uFF0C\u5C06path\u6DFB\u52A0\u5230res\u4E2D",paraId:162,tocIndex:35},{value:"\u8DDF",paraId:162,tocIndex:35},{value:"113.\u8DEF\u5F84\u603B\u548C-ii",paraId:163,tocIndex:35},{value:"\u76F8\u540C",paraId:162,tocIndex:35},{value:`/**
 * @param {TreeNode} root
 * @param {number} target
 * @return {number[][]}
 */
var pathSum = function (root, target) {
    const res = [];

    const backTrack = (root, sum, track) => {
        if (root === null) return;
        const remain = sum - root.val;
        // \u5F53\u8D70\u5230\u53F6\u5B50\u7ED3\u70B9
        if (root.left === null && root.right === null) {
            // \u5224\u65ADremain\u662F\u5426\u4E3A0,\u8BF4\u660E\u627E\u5230\u4E00\u6761\u8DEF\u5F84
            if (remain === 0) {
                track.push(root.val);
                res.push([...track]);
                track.pop();
            }
            return;
        }

        track.push(root.val);
        backTrack(root.left, remain, track);
        track.pop();

        track.push(root.val);
        backTrack(root.right, remain, track);
        track.pop();
    }

    backTrack(root, target, []);
    return res;
};
