var moveZeroes = function (nums) {
  // \u5148\u4F7F\u7528\u3010\u79FB\u9664\u5143\u7D20\u3011\uFF0C\u5C06\u6570\u7EC4\u4E2D0\u7684\u5143\u7D20\u5220\u9664
  // \u8FD4\u56DEnums\u7684length\uFF0C\u4E14nums[0,p-1]\u5DF2\u7ECF\u539F\u5730\u5220\u9664\u4E860
  let p = removeElement(nums, 0);
  for (; p < nums.length; p++) {
    nums[p] = 0;
  }
  return nums;
};
